    for j in range(0, 21):
        if j + nums[i + 1] <= 20:
            dp[i + 1][j + nums[i + 1]] += dp[i][j]
        if j - nums[i + 1] >= 0:
            dp[i + 1][j - nums[i + 1]] += dp[i][j]

